(226, 128, 289, 'well I know that both are used for the user interface and for front and however it is more for the front and view dojas can also work with the back end I am comfortable with using feudal JS because I\'m working on it in my Senior Year project I am currently building an chatbot that acts like an AI mock interview website ok to give the user feedback on their skills and give them a full generated report with insights on how to improve and the detects all the metrics and so on', NULL, '2026-01-13 12:35:21'),
