(121, 32, 'Hi! So glad to have you here! Now, tell me a little bit about what interests you in front-end development?', 'medium', 0, 0),
(122, 32, 'Great! It\'s fantastic to hear you have some practical experience from Greateck! Okay, based on your resume, can you tell me about a project you worked on during your internship that you\'re particularly proud of and what role you played?', 'medium', 0, 0),
(123, 32, 'That sounds like a really interesting project! The dark/light mode compatibility across devices is a great challenge! So, regarding Actifit.io, can you describe a specific technical challenge you faced while developing the homepage and how you overcame it?', 'medium', 0, 0),
(124, 32, 'Okay, nice work on that! Now, about that carousel: What tools or technologies did you use to implement it?', 'medium', 0, 0),
(125, 32, 'Awesome! So you used Vue for that. Can you tell me a little bit more about how you ensured the carousel was responsive across different screen sizes?', 'medium', 0, 0),
(126, 32, 'Great! And how did you handle the different screen sizes to ensure responsiveness? Did you utilize any CSS frameworks or techniques like media queries, or a grid system?', 'medium', 0, 0),
(127, 32, 'Okay! So, without using CSS frameworks, how did you approach making the carousel look good on both desktop and mobile?', 'medium', 0, 0),
(128, 32, 'Gotcha! So you used CSS directly for responsiveness. That\'s great!\n\nOkay, next question: Can you give me an example of a time you had to debug a particularly tricky front-end issue?', 'medium', 0, 0),
(129, 32, 'Okay! I think console logs and inspect are great for debugging!\n\nNext question: Have you ever taught or mentored someone in a front-end development concept?', 'medium', 0, 0),
(130, 32, 'That\'s awesome you have teaching experience!\n\nSo, how do you stay up-to-date with the latest front-end trends and technologies?', 'medium', 0, 0),
(131, 33, 'Hi Ghina, thanks for coming in today! It\'s great to finally meet you.\n\nNow that we\'ve settled in, let\'s dive into your experience. Looking at your resume, you\'ve clearly been involved in a variety of projects. Can you tell me about a specific front-end project you\'re particularly proud of, and what your role was in its success? What challenges did you face and how did you overcome them?', 'medium', 0, 0),
(132, 33, 'That sounds like a fantastic experience, Ghina! Actifit.io sounds like a really interesting project. It\'s great you got to work on revamping such a key part of the website.\n\nOkay, digging a little deeper: considering the changes you made to the homepage and the reusable components you created, could you tell me about a specific technical challenge you encountered during the process? And how did you go about solving it? I\'m interested in hearing about your problem-solving approach in a real-world setting.', 'medium', 0, 0),
(133, 33, 'Okay, that makes sense. Working with backend data is a crucial part of front-end development.\n\nSo, let\'s elaborate on that a bit: when fetching the user data from the backend to display in the carousels, what specific technologies or methods did you utilize? For example, did you use REST APIs, GraphQL, or something else? And could you describe any challenges you faced with data formatting, asynchronous requests, or potential performance issues when displaying this data in the carousel?', 'medium', 0, 0),
(134, 33, 'That\'s a good initial approach to troubleshooting, Ghina! The console and network tabs are definitely a front-end developer\'s best friends.\n\nOkay, so you were provided with an API endpoint. That\'s helpful to know. My next question is related to the user experience and performance. Carousels can sometimes be tricky to optimize for different devices and connection speeds.\n\nHow did you ensure the carousels you built for Actifit.io were responsive and performed well, especially considering the user data you were fetching? Did you implement any specific optimization techniques for loading images, handling large datasets, or ensuring smooth transitions between slides?', 'medium', 0, 0),
(135, 33, 'Okay, that\'s a good strategy! Chunking the data can definitely help with performance.\n\nFollowing up on that: Could you elaborate on *how* you divided the data into smaller chunks and fetched them? Did you use techniques like pagination or lazy loading? Were there any specific libraries or tools that you found helpful in implementing this? And how did you determine the optimal chunk size to balance performance with user experience?', 'medium', 0, 0),
(136, 33, 'Excellent! You\'ve touched on lazy loading, which is a great technique for optimizing performance.\n\nMy next question focuses on collaboration and code quality. As a front-end teacher assistant, you\'ll be guiding students. Can you describe your experience with code reviews or working in a collaborative coding environment, either at Greeteck or in personal projects? How do you ensure code quality, readability, and maintainability when working on a team? Do you have experience with tools like Git for version control and collaboration?', 'medium', 0, 0),
(137, 33, 'Thanks for your honesty, Ghina! It\'s good to know where you stand.\n\nOkay, let\'s shift gears a bit. Since this role involves assisting students, I\'d like to understand your approach to teaching and problem-solving from that perspective.\n\nImagine one of your students is struggling to understand the concept of \"props\" in React. How would you explain props to them in a way that\'s easy to grasp, and what kind of examples would you use to illustrate their importance and functionality? Try to keep it simple and beginner-friendly!', 'medium', 0, 0),
(138, 33, 'That sounds like a very thoughtful and student-centered approach, Ghina! Starting with understanding their current knowledge is a great way to tailor your explanation.\n\nNow, let\'s say after your explanation and practical example, the student is *still* struggling to grasp the concept of props, particularly how data flows from a parent component to a child component. What\'s another way you could explain it, perhaps using a different analogy or a more visual approach, to help solidify their understanding? How would you know if they finally \"got it\"?', 'medium', 0, 0),
(139, 33, 'That\'s a great way to check for understanding, Ghina! Exercises and quizzes are definitely helpful.\n\nOkay, let\'s move on to a slightly different area. A big part of front-end development is staying up-to-date with the latest technologies and trends.\n\nWhat are some front-end technologies or frameworks that you\'re particularly interested in learning more about, and why? Are there any recent developments in the front-end world that have caught your eye? How do you typically stay current with industry trends (e.g., blogs, podcasts, online courses)?', 'medium', 0, 0),
(140, 33, 'That\'s great that you\'re proactive about learning, Ghina! Online courses are a fantastic way to stay up-to-date.\n\nOkay, for my final question: Imagine you\'re assisting a student who is building a responsive website, and they\'re struggling with making their layout work well on both desktop and mobile devices. What are some key concepts or techniques you would introduce to help them achieve a responsive design, and what resources might you recommend for them to learn more?', 'medium', 0, 0),
(141, 33, 'Okay, those are all great resources, Ghina! They offer a wealth of information for aspiring front-end developers.\n\nTo wrap up, do you have any questions for me about the teacher assistant position, the team you\'d be working with, or anything else related to the role? It\'s your chance to learn more about us!', 'medium', 0, 0),
(142, 34, 'Okay, great to meet you!  So, to start, tell me a little bit about what interests you most about working with students in front-end development?', 'medium', 0, 0),
(143, 34, 'Okay, great! Building on that, could you tell me a bit about the **most challenging project you worked on during your internship and what you learned from overcoming that challenge?**', 'medium', 0, 0),
(144, 34, 'That\'s great! In creating those reusable components, what strategies are you using to ensure they\'re accessible and maintainable across different projects?', 'medium', 0, 0),
(145, 35, 'Okay, hello! Thanks for being here.\n\nSo, what are your strongest technical skills?', 'medium', 0, 0),
(146, 35, 'Interviewer: Nice background! What front-end frameworks are you most comfortable with?', 'medium', 0, 0),
(147, 35, 'Interviewer: Okay, Vue experience is great. Briefly describe your teaching style.', 'medium', 0, 0),
(148, 35, 'Interviewer: Sounds thorough! How do you handle students who are struggling with the material?', 'medium', 0, 0),
(149, 35, 'Interviewer: That\'s a proactive approach. Tell me about a time you helped a student overcome a significant challenge.', 'medium', 0, 0),
