(153, 36, 'Okay, Ghina, thanks for persevering! My apologies, I seem to be having some audio issues. Let\'s move forward.\n\nSo, tell me, what draws you to teaching web development specifically?', 'medium', 0, 0),
(154, 36, 'Okay, great! Revamping the front-end and creating reusable components is excellent experience.\n\nSo, what teaching experience do you have, either formal or informal?', 'medium', 0, 0),
(155, 36, 'Okay, two years as a teaching assistant and private tutoring is good groundwork. That shows you\'re comfortable explaining concepts.\n\nNext question: What are your favorite tools and technologies in web development right now? And why?', 'medium', 0, 0),
(156, 36, 'Okay, it sounds like you\'re describing platforms used for *delivering* web development content, not the *tools and technologies* of web development itself. Could you clarify what programming languages, frameworks, libraries, and tools you enjoy using for *writing code* and *building websites and applications*? For example, do you like React, Angular, Vue.js, JavaScript, Python, HTML, CSS, or specific build tools?', 'medium', 0, 0),
(157, 37, 'Okay, thanks!\n\nWhat interests you about front-end development?', 'medium', 0, 0),
(158, 37, 'Interviewer: Great! What was your biggest challenge during that internship?', 'medium', 0, 0),
(159, 37, 'Interviewer: And what resources did you find most helpful for learning those languages?', 'medium', 0, 0),
(160, 37, 'Interviewer: Got it. What\'s your preferred learning style?', 'medium', 0, 0),
(161, 37, 'Interviewer: Okay, good. How would you explain a complex front-end concept, like \"the DOM,\" to a beginner?', 'medium', 0, 0),
(162, 37, 'Interviewer: Sounds good. Can you give me an example of a time you successfully helped someone understand a difficult concept?', 'medium', 0, 0),
(163, 38, 'Thanks for coming in. Can you tell me a little about your background and experience with web development, specifically focusing on the technologies you\'re most comfortable teaching?', 'medium', 0, 6),
(164, 38, 'Could you elaborate on why you consider HTML, CSS, and JavaScript easier to teach than more \'popular technologies\'? Can you give specific examples of these \'popular technologies\' and compare their challenges for students compared to the front-end fundamentals?', 'medium', 0, 4),
(165, 38, 'I understand that you find the syntax of HTML and CSS straightforward. However, many modern web development frameworks and libraries, like React, Angular, or Vue, emphasize component-based architecture and state management, which address scalability and maintainability challenges in larger projects. How would you introduce these concepts to students who are already familiar with HTML, CSS, and JavaScript, and what challenges do you anticipate they might face in adopting these frameworks?', 'medium', 0, 6),
(166, 38, 'That\'s a reasonable approach. However, many students come into the course with varying levels of prior experience and expectations about learning modern technologies. Could you outline a specific, modular curriculum plan that incorporates both foundational HTML, CSS, and JavaScript, and introduces a more advanced framework (like React, Angular, or Vue), including a timeline for each module and how you\'d assess student understanding at each stage?', 'medium', 0, 4),
(167, 38, 'I appreciate your flexibility. However, for accreditation purposes and to ensure students are well-prepared for the job market, we need a structured curriculum plan. Could you describe a concrete example of how you would integrate React into a web development course, assuming the first half of the semester is dedicated to HTML, CSS, and JavaScript fundamentals? Be specific about the React concepts you\'d cover, the types of projects you\'d assign, and how you\'d evaluate student learning in that second half of the semester. I\'m looking for details like specific project ideas or assessment methods you might use.', 'medium', 0, 0),
(168, 39, 'Hi there! Thanks for expressing interest in the CS mentor position. To start, could you tell me a bit about why you\'re interested in becoming a mentor, and what you hope to gain from the experience?', 'medium', 0, 6),
(169, 39, 'That\'s great. Can you elaborate on the specific types of struggles you\'ve witnessed or experienced as a CS major, and how you think your advice would be particularly helpful in overcoming them?', 'medium', 0, 6),
(170, 39, 'That\'s a valuable point. Building confidence is crucial. Could you give me a specific example of a time when you helped a fellow student overcome a challenge in a CS course, and what strategies you used to support them?', 'medium', 0, 0),
(171, 40, 'Hi there! Thanks for connecting. To start, can you tell me a little bit about what you\'re hoping to gain from a mentorship?', 'medium', 0, 6),
(172, 40, 'That\'s great that you want to share your experiences! Can you be a bit more specific about the struggles you faced and what kind of advice you think would be most helpful to new CS students? This will help me understand your strengths as a mentor.', 'medium', 0, 8),
(173, 40, 'That\'s a fantastic idea! A study plan tailored to manage the workload is incredibly valuable. To make that plan as effective as possible, could you tell me more about which courses you found particularly challenging to take together and why? Also, what kind of learning styles or preferences do you think the plan should cater to?', 'medium', 0, 8),
(174, 40, 'That\'s a very insightful point about those specific courses! Thinking about the students you\'d be mentoring, do you have any specific strategies in mind to help them identify which \"lighter\" courses would complement the more challenging ones? Also, how would you help students balance their study time for these different types of courses?', 'medium', 0, 5),
(175, 40, 'Could you elaborate?', 'medium', 0, 0),
(176, 41, 'Hello! Thanks for coming in. To start, can you tell me a bit about why you\'re interested in becoming a mentor in computer science?', 'medium', 0, 7),
(177, 41, 'That\'s a very empathetic observation. Could you tell me about any experiences you\'ve had where you\'ve helped someone navigate a challenging situation in computer science, whether formally or informally?', 'medium', 0, 6),
(178, 41, 'That\'s a great initiative! Can you elaborate on what that study plan would entail? What specific areas or topics would it cover, and how would you tailor it to different learning styles or levels of experience?', 'medium', 0, 7),
(179, 41, 'That sounds like a really innovative approach! Could you describe a specific example of how your survey would identify a student\'s needs and how the automated study plan would adapt to meet those needs in practice? For instance, what if a student struggles with a particular programming concept like recursion?', 'medium', 0, 0),
(180, 42, 'Hi there! Thanks for connecting. To start, can you briefly describe your experience with front-end development and what specifically attracts you to the role of a mentor?', 'medium', 0, 6);
