(181, 42, 'That\'s great that you\'re coming straight from a CS program and internship. To get a better understanding of how you might guide others, could you describe a specific technical challenge you faced during your front-end internship and how you overcame it? This will help me gauge your problem-solving approach and your ability to articulate solutions.', 'medium', 0, 0),
(182, 43, 'Hi there! Thanks for joining me today. To start, can you tell me a little bit about yourself and what interests you about working as a teacher assistant in a web development program?', 'medium', 0, 7),
(183, 43, 'That\'s great to hear! Your front-end internship and prior teaching experience are definitely relevant. Can you elaborate on your responsibilities and the technologies you used during your front-end internship? Also, what specific subjects or age groups did you tutor and assist with for those two years?', 'medium', 0, 7),
(184, 43, 'Thanks for clarifying! It sounds like you have a good grasp of the fundamentals. Can you give me a specific example of a time when you helped a student overcome a significant challenge in their web development project? What was the challenge, and how did you guide them to a solution?', 'medium', 0, 3),
(185, 43, 'Okay, I understand. Thinking more broadly about your experience as a tutor and TA, what general strategies did you find most effective in helping students understand difficult web development concepts, even if you can\'t recall a specific instance?', 'medium', 0, 0),
