(187, 44, 'I understand you\'re a CS student who wants to help others. That\'s wonderful! To better understand how you\'d approach mentoring, could you describe a specific challenge you\'ve overcome in your CS studies, and how you managed to do it?', 'medium', 0, 6),
(188, 44, 'That\'s great you created a study plan! Could you elaborate on what that study plan looked like, and specifically, how you tailored it to address your struggles in CS? What were some key components and how did you track your progress?', 'medium', 0, 6),
(189, 44, 'Okay, you mentioned \'schedule.\' Could you be more specific about what that schedule entailed? For example, how did you allocate time to different CS topics, what resources did you use, and how did you adjust the schedule when you fell behind or found something particularly challenging?', 'medium', 0, 0),
(190, 45, 'Hi there! Thanks for joining me. To start, could you tell me a little bit about why you\'re interested in becoming a CS mentor and what you hope to gain from the experience?', 'medium', 0, 7),
(191, 45, 'That\'s admirable! Can you tell me more about the specific areas you struggled with in CS and how you overcame those challenges? This will help me understand what kind of support you\'d be best suited to provide.', 'medium', 0, 7),
(192, 45, 'That\'s great you\'re looking to help others with time management and stress! Many students face similar challenges. To understand how you\'d approach this as a mentor, could you describe a specific study plan you would create for a struggling CS student, considering factors like their current workload and learning style?', 'medium', 0, 0),
