(309, 134, 'Ghina, I\'ve noticed you\'re looking away a bit and your posture is a little slouched. Try to make eye contact with the camera and sit up straight; it really helps convey confidence and engagement during our discussion. On a different note, your Senior Project, the AI Mock Interview Platform, is quite interesting, especially with its AI-based eye contact and posture analysis. Could you elaborate on the front-end challenges you encountered when designing and implementing the user interface for displaying that real-time feedback or integrating the speech-to-text/text-to-speech features?', 'easy', 0, 5),
