(319, 137, 'That\'s fantastic. It sounds like you had a very productive internship at Greateck, especially with revamping the homepage and creating reusable components. Could you tell me about a specific instance where you faced a technical challenge while working on those reusable components or the homepage revamp, and how you went about solving it?', 'medium', 0, 7),
(320, 137, 'That\'s a very practical solution to a common front-end challenge, Ghina. You mentioned in your CV a strong interest in user-focused design and also worked on UI enhancements and responsive design improvements during your internships at Greateck. Could you elaborate on your approach to ensuring a user-friendly and responsive experience, especially when dealing with elements like animations, carousels, or complex data visualizations?', 'medium', 0, 7),
(321, 137, 'That\'s a good overview of your approach to responsive design and animations, Ghina. Given your experience at Greateck working on data visualization issues for the Hive blockchain explorer, could you share a specific example of a data visualization challenge you encountered and how you resolved it to ensure clarity and accuracy for the users?', 'medium', 0, 2),
(322, 137, 'Ghina, your senior project on the AI Mock Interview Platform sounds quite ambitious, especially with the integration of real-time AI features like speech-to-text, emotion analysis, and custom interview questions. Could you walk me through some of the key technical challenges you faced in integrating these complex functionalities into the web application, particularly from a front-end perspective, and how you ensured a smooth, responsive user experience?', 'medium', 0, 3),
(323, 137, 'Thank you for clarifying that, Ghina. Given the complexity of your AI Mock Interview Platform and the integration of real-time AI features, how did you manage the asynchronous operations and data flow between the front-end and these different backend endpoints to ensure a seamless and responsive user experience? Could you elaborate on any specific patterns or tools you used for this?', 'medium', 0, 0),
(324, 138, 'Ghina, it\'s a pleasure to meet you. Thank you for coming in today. To start, could you please tell me a bit about yourself and what specifically drew you to front-end web development?', 'medium', 0, 6),
(325, 138, 'You mentioned your time at Greateck. Could you tell me more about one of the projects you worked on there – perhaps one you found particularly interesting or challenging – and what specific front-end contributions you made?', 'medium', 0, 7.5),
(326, 138, 'It sounds like you gained valuable experience working with different UI elements and handling challenges with data display. I see from your CV that you\'ve worked with both Vue.js and React.js. Could you tell me about a significant difference in your development approach or workflow when using one framework versus the other, and perhaps why you might choose one over the other for a particular project?', 'medium', 0, 4),
(327, 138, 'Your senior project, the AI Mock Interview Platform, integrates several advanced features like speech-to-text and AI-based analysis. From a front-end perspective, what were the most significant design or implementation challenges in presenting this complex, real-time data and functionality to the user in an intuitive and responsive way?', 'medium', 0, 4),
(328, 138, 'You mentioned enhancing user interfaces and implementing animated elements like progress bars and carousels at Greateck. Can you describe a specific front-end technical challenge you encountered while building or optimizing these interactive UI components, and how you approached solving it to ensure both performance and a smooth user experience?', 'medium', 0, 0),
(329, 139, 'Hi there! I\'m [Interviewer Name], a Senior Frontend Developer here. Thanks for joining us today for this Frontend Web Developer interview. To kick things off, could you please tell me a bit about yourself and what specifically drew you to frontend development?', 'medium', 0, 3),
(330, 139, 'That\'s great you got some practical experience! It sounds like you\'ve been hands-on recently. What specifically drew you to frontend development, and what did you find most engaging about the work you did during your internship?', 'medium', 0, 75),
(331, 139, 'That\'s fantastic that you\'re passionate about responsive design and creating reusable components. It sounds like you got to build some interesting things! Could you perhaps walk me through a specific example of a reusable component you developed, or a challenging responsive design problem you encountered during your internship? What was your process, and what did you learn from that experience?', 'medium', 0, 4),
(332, 139, 'That\'s a great example of a real-world problem, and it\'s clear you put in a lot of effort to debug and find a solution that didn\'t disrupt existing work. Your learning about patience and investigation is spot on! Could you elaborate a bit more on your debugging process for this specific issue? What tools or techniques did you find most helpful in diagnosing the proxy configuration problem and then isolating the valid image sources?', 'medium', 0, 3),
(333, 139, 'The network tab is indeed an indispensable tool for debugging front-end issues! Could you elaborate a bit more on what specific details or patterns you were looking for within the network tab that helped you diagnose the proxy configuration problem? And once you identified that, how did you use the network tab, or perhaps other techniques, to effectively isolate the valid image sources?', 'medium', 0, 0),
(334, 141, 'Hi Ghina, it\'s lovely to meet you! I\'m [Interviewer\'s Name], and I\'m really excited to chat with you today about our Front-End Developer role. To kick things off, your CV highlights a strong interest in front-end development and user-focused design. Could you tell me a bit more about what specifically draws you to front-end work?', 'medium', 0, 8.5),
