(354, 152, 'Hey Ghina, it\'s great to have you here today! Just a quick friendly tip, try to maintain eye contact and good posture as we chat, it helps a lot with engagement. Now, diving into your CV, I\'m really interested in your second role at Greateck as a Front-End Web Developer using React.js. You mentioned revamping user interfaces and fixing data visualization issues related to graphs and cryptocurrency values. Could you walk me through a specific data visualization challenge you encountered there and how you went about solving it?', 'medium', 0, 5),
